import React from 'react';
export default function About() {
  return (
    <section id="about" className="section-card" data-aos="fade-up">
      <h3>Professional Summary</h3>
      <p>Full-Stack Web Developer with 3+ years of experience in PHP, React.js, Redux, Redux-Saga, and MySQL. Skilled in building scalable web applications, responsive UIs, and RESTful APIs. Strong problem-solving and debugging skills, delivering high-quality projects in Agile environments.</p>
    </section>
  );
}
